    return (
        <div>
            <ApplicationBar/>
            <Grid container wrap="wrap" style={{border: 'red solid 1px'}}>
                <Grid item xs={6} id="box1"></Grid>
                <Grid item xs={6} id="box2">
                    <Grid item id="text">
                        <Typography variant="h1" noWrap>Hello,</Typography>
                        <Typography variant="h1" noWrap>I'm Latifa</Typography>
                    </Grid>
                </Grid>
            </Grid>
        </div>
    );
}

export default App;


